Aspirateur de qualité, excellent, le cable secteur peut etre un peu court mais c'est un détail.

Cependant, j'ai bien fait attention de commander la version PREMIUM, qui est censé avoir deux jeux de brosses, une mixte pour tapis et un autre jeu special pour EAU. Or, ce dernier est manquant, j'essaies toujours de trouver comment contacter Jumia pour ce soucis. 

Aussi, le délai de livraison a été dépassé de 6 jours par rapport au délai annoncé;
